function Table(props) {
  return (
    <tr>
      <td>{props.song}</td>
      <td>{props.score}</td>
      <td>
        <button onClick={() => props.updateScore(props.song, props.score - 1)}>
          upvote
        </button>
      </td>
      <td>
        <button onClick={() => props.scoreChange(props.song, props.score - 1)}>
          downvote
        </button>
      </td>
    </tr>
  );
}

export default Table;
